#Trevi Fountain, Trevi district, Rome. It is the largest Baroque fountain in the city and one of the most famous fountains in the world. Built in 1762, the site marks the terminal point of the "modern" Acqua Vergine, the revived Aqua Virgo, one of the aqueducts that supplied water to ancient Rome built in 19 BC, supposedly with the help of a virgin.
